DROP TABLE IF EXISTS surveys CASCADE;
DROP TABLE IF EXISTS donations CASCADE;
DROP TABLE IF EXISTS milestones CASCADE;
DROP TABLE IF EXISTS registrations CASCADE;
DROP TABLE IF EXISTS event_instances CASCADE;
DROP TABLE IF EXISTS event_definitions CASCADE;
DROP TABLE IF EXISTS participants CASCADE;
DROP TABLE IF EXISTS app_user CASCADE;

-- ============================================================================
-- CREATE TABLES (3NF Schema)
-- ============================================================================

CREATE TABLE app_user (
    user_id SERIAL PRIMARY KEY,
    username VARCHAR(255) NOT NULL,
    password_hash VARCHAR(255) NOT NULL,
    role TEXT NOT NULL,
    created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP
);



CREATE TABLE event_definitions (
    event_definition_id VARCHAR(10) PRIMARY KEY,
    event_name VARCHAR(255) NOT NULL,
    event_type VARCHAR(100) NOT NULL,
    event_description TEXT,
    event_recurrence_pattern VARCHAR(50),
    event_default_capacity NUMERIC(10, 2) NOT NULL,
    created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP
);

CREATE TABLE event_instances (
    event_instance_id VARCHAR(10) PRIMARY KEY,
    event_definition_id VARCHAR(10) NOT NULL,
    event_date_time_start TIMESTAMP NOT NULL,
    event_date_time_end TIMESTAMP NOT NULL,
    event_location VARCHAR(255),
    event_capacity NUMERIC(10, 2),
    event_registration_deadline TIMESTAMP,
    created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
    FOREIGN KEY (event_definition_id) REFERENCES event_definitions(event_definition_id)
);

CREATE TABLE participants (
    participant_id VARCHAR(10) PRIMARY KEY,
    participant_email VARCHAR(255) UNIQUE NOT NULL,
    participant_first_name VARCHAR(100),
    participant_last_name VARCHAR(100),
    participant_dob DATE,
    participant_role VARCHAR(50),
    participant_phone VARCHAR(20),
    participant_city VARCHAR(100),
    participant_state VARCHAR(2),
    participant_zip VARCHAR(10),
    participant_school_or_employer VARCHAR(255),
    participant_field_of_interest VARCHAR(100),
    created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP
);

CREATE TABLE registrations (
    registration_id VARCHAR(10) PRIMARY KEY,
    participant_id VARCHAR(10) NOT NULL,
    event_instance_id VARCHAR(10) NOT NULL,
    registration_status VARCHAR(50),
    registration_attended_flag NUMERIC(1, 0),
    registration_check_in_time TIMESTAMP,
    registration_created_at TIMESTAMP,
    created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
    FOREIGN KEY (participant_id) REFERENCES participants(participant_id),
    FOREIGN KEY (event_instance_id) REFERENCES event_instances(event_instance_id),
    UNIQUE (participant_id, event_instance_id)
);

CREATE TABLE surveys (
    survey_id VARCHAR(10) PRIMARY KEY,
    registration_id VARCHAR(10) NOT NULL UNIQUE,
    survey_satisfaction_score NUMERIC(3, 1),
    survey_usefulness_score NUMERIC(3, 1),
    survey_instructor_score NUMERIC(3, 1),
    survey_recommendation_score NUMERIC(3, 1),
    survey_overall_score NUMERIC(3, 2),
    survey_nps_bucket VARCHAR(50),
    survey_comments TEXT,
    survey_submission_date TIMESTAMP,
    created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
    FOREIGN KEY (registration_id) REFERENCES registrations(registration_id)
);

CREATE TABLE milestones (
    milestone_id VARCHAR(10) PRIMARY KEY,
    participant_id VARCHAR(10) NOT NULL,
    milestone_title VARCHAR(255),
    milestone_date DATE,
    created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
    FOREIGN KEY (participant_id) REFERENCES participants(participant_id)
);

CREATE TABLE donations (
    donation_id VARCHAR(10) PRIMARY KEY,
    participant_id VARCHAR(10) NOT NULL,
    donation_date DATE,
    donation_amount NUMERIC(10, 2),
    created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
    FOREIGN KEY (participant_id) REFERENCES participants(participant_id)
);

-- ============================================================================
-- CREATE INDEXES FOR PERFORMANCE
-- ============================================================================

CREATE INDEX idx_participants_email ON participants(participant_email);
CREATE INDEX idx_participants_city_state ON participants(participant_city, participant_state);
CREATE INDEX idx_registrations_participant_id ON registrations(participant_id);
CREATE INDEX idx_registrations_event_instance_id ON registrations(event_instance_id);
CREATE INDEX idx_registrations_status ON registrations(registration_status);
CREATE INDEX idx_surveys_registration_id ON surveys(registration_id);
CREATE INDEX idx_milestones_participant_id ON milestones(participant_id);
CREATE INDEX idx_milestones_date ON milestones(milestone_date);
CREATE INDEX idx_donations_participant_id ON donations(participant_id);
CREATE INDEX idx_donations_date ON donations(donation_date);
CREATE INDEX idx_event_instances_start_time ON event_instances(event_date_time_start);
CREATE INDEX idx_event_definitions_type ON event_definitions(event_type);

