FROM surveys sv
LEFT JOIN registrations r ON sv.registration_id = r.registration_id
WHERE r.registration_id IS NULL

UNION ALL

SELECT ' FK: Milestones  Participants', COUNT(*)
FROM milestones m
LEFT JOIN participants p ON m.participant_id = p.participant_id
WHERE p.participant_id IS NULL

UNION ALL

